import React from "react";
import Map from "./Map";
import TopNavbar from "./TopNavbar";
import {Container , Row, Col } from 'react-bootstrap';
import './MyComponent.css';

export default class MyComponent extends React.Component {

	render() {
		return (				
			<Container fluid={true}>
			<Row>
			  <Col>1 of 2</Col>
			  <Col>2 of 2</Col>
			</Row>
		  </Container>
		);
	}
}
